script: |
  super -f text -I q3405.spq | sort > q3405.out

inputs:
  - name: q3405.spq
    data: |
      SELECT - col1 * + tab2.col0 * - tab2.col0 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT ( - col1 * col0 * - col1 ) NOT IN ( col1 - col0 );
  - name: tab2

outputs:
  - name: q3405.out
    data: |
